def removeDuplicates(s: str, k: int) -> str:
    stack = []

    for char in s:
        if stack and stack[-1][0] == char:
            stack[-1] += char
            if len(stack[-1]) == k:
                stack.pop()
        else:
            stack.append(char)
    return "".join(stack)
